query HomeQuery {
  ...MessageList_query
}

fragment MessageListTable_messageRecord on MessageRecord {
  id
  title
  receivedAt
  type
  provider
  to
}

fragment MessageListTable_messagesEdge on MessagesEdge {
  node {
    id
    ...MessageListTable_messageRecord
  }
}

fragment MessageList_query on Query {
  messages(first: 30) {
    edges {
      ...MessageListTable_messagesEdge
      cursor
      node {
        __typename
        id
      }
    }
    pageInfo {
      endCursor
      hasNextPage
    }
  }
}

